import net.sf.json.groovy.*;

def resBody = context.expand( '${Display stock in bi\'s all items#res_stockInBiItems}' );
def itemId = context.expand( '${Properties for itemId of nonSerialized#firstRunItemId}' ) as Integer;
def itemId2 = context.expand( '${Properties for itemId of nonSerialized#firstRunItemId}' ) as Integer;
def jsonBody = new JsonSlurper().parseText(resBody);
int count = 0;
//testRunner.testCase.testSteps['Properties for itemId of nonSerialized'].setPropertyValue("firstRunItemId",resId.toString());
for (int i=0; i < jsonBody.size(); i++){
	def id = jsonBody[i].id as Integer;
	
	if ((id == itemId)  || (id == itemId - 10)) {

		count ++;
	}
	if ((id == itemId2) || (id == itemId2 - 10)) {

		count ++;
	}
}
//return count
if (count == 2) return true;
else return false;

import net.sf.json.groovy.*;

def resBody = context.expand( '${Display stock in bi\'s all items#res_stockInBiItems}' );
def serializedItemId = context.expand( '${Add serialized stockIn item#res_itemId}' ) as Integer;
def jsonBody = new JsonSlurper().parseText(resBody);

for (int i=0; i < jsonBody.size(); i++){
	def itemId = jsonBody[i].id as Integer;
	
	if ((itemId == serializedItemId)) {
		return true;
	}
}

return false;

